package com.Assignment5;

public class SwapNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int s  = 80;
         int h =   55;
         int k =s;
         System.out.println("before swap :"+s+" "+h);
         s=h;
         h=k;
         
         
         System.out.println("after swap:"+s+" "+h);
	}

}
